export default function Scoreboard() {

    useEffect(() => {
        fetch("https://api.scorebooklive.com/v2/games?date=2023-01-13&primary=true&priority_order=true&status_id=1")
        .then(res => {
            if(!res.ok) {
                throw Error("Something went wrong")
            }
            return res.json()
        })
        .then(data => console.log(data))
        .catch(err => console.error(err))
    })
    return (
        <>
